import React from 'react';
import { Box, Typography, Card, CardContent } from '@mui/material';

const MedicalUserManagement: React.FC = () => {
  return (
    <Box>
      <Typography variant="h4" fontWeight={700} gutterBottom>
        Medical Portal Users
      </Typography>
      <Typography variant="body1" color="text.secondary" sx={{ mb: 4 }}>
        Manage users of the medical portal (doctors, nurses, teachers, parents)
      </Typography>

      <Card>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Medical User Management Interface
          </Typography>
          <Typography variant="body2" color="text.secondary">
            This page will contain the medical user management interface.
            It will connect to the shared backend API at http://localhost:8013.
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default MedicalUserManagement;
